def gexp(w,dety,detz,wx,wy,tx,ty,tz,py,pz,cy,cz,L,x,y,z):
	 Omega = tools.quart2Omega(w,wx,wy)
	 R = tools.detect_tilt(tx,ty,tz)
	 d = n.dot(R,n.array([[0],[(dety-cy)*py],[(detz-cz)*pz]])) 
	 d = d + n.array([[L],[0],[0]]) - n.dot(Omega,n.array([[x],[y],[z]]))
	 gexp = n.dot(n.linalg.inv(Omega),(d/n.sqrt(n.sum(d**2)) - n.array([[1],[0],[0]])))
	 return gexp 

def gcalc(h,k,l,w,dety,detz,wx,wy,phia,PHI,phib,epsaa,epsab,epsac,epsbb,epsbc,epscc):
	 Omega = tools.quart2Omega(w,wx,wy)
	 B = tools.epsilon2B(n.array([epsaa,epsab,epsac,epsbb,epsbc,epscc]),unit_cell)
	 U = tools.euler2U(phia*n.pi/180,PHI*n.pi/180,phib*n.pi/180)
	 Bhkl = n.dot(B,n.array([[h],[k],[l]]))
	 gcalc = (wavelength/(2*n.pi))*n.dot(U,Bhkl) 
	 return gcalc 

def peak(h,k,l,w,dety,detz,vars,wx,wy,tx,ty,tz,py,pz,cy,cz,L,x,y,z,phia,PHI,phib,epsaa,epsab,epsac,epsbb,epsbc,epscc):
	 diff = gexp(w,dety,detz,wx,wy,tx,ty,tz,py,pz,cy,cz,L,x,y,z)-gcalc(h,k,l,w,dety,detz,wx,wy,phia,PHI,phib,epsaa,epsab,epsac,epsbb,epsbc,epscc)
	 result = n.sum(diff*diff/n.array([[vars[0]],[vars[1]],[vars[2]]]))
	 return result 

